import React, {FC} from 'react';
import {ITrait} from "@entities/trait";

type TaskTraitProps = {
    trait: ITrait,
};

export const TaskTrait: FC<TaskTraitProps> = (props) => {
    const {trait} = props;

    return (
        <div>
            <p>{trait.name}</p>
        </div>
    );
};
